import React from 'react';
import Link from 'next/link';

class Home extends React.Component {

    render() {
        return (
            <>
                <p>Sell Page!</p>

                <Link href="/">
                    <a>Go to Home</a>
                </Link>
            </>
        );
    }
}

export default Home;
